(469, 2, '2. Preview generated metas', 'Previsualizar METAS generados', NULL, '2010-06-09 17:30:16', '2010-06-09 17:30:16'),
(470, 2, 'The page url, without domain name. Must be unique. If the slug does not start with a ''/'', the parent slug is added.', 'La dirección de la página (URL) sin el nombre de dominio. Debe ser única. Si el slug no comienza con ''/'', se añade el slug del padre.', NULL, '2010-06-09 17:30:16', '2010-06-09 17:30:16'),
